function modalNotify(text) {
  $("#popup-notify").find(".modal-body").html(text);
  $("#popup-notify").modal("show");
}
function ValidationFormSelf(ele = "") {
  if (ele) {
    $("." + ele)
      .find("input[type=submit]")
      .removeAttr("disabled");
    var forms = document.getElementsByClassName(ele);
    var validation = Array.prototype.filter.call(forms, function (form) {
      form.addEventListener(
        "submit",
        function (event) {
          if (form.checkValidity() === false) {
            event.preventDefault();
            event.stopPropagation();
          }
          form.classList.add("was-validated");
        },
        false
      );
    });
  }
}
function loadPagingAjax(url = "", eShow = "") {
  if ($(eShow).length && url) {
    $.ajax({
      url: url,
      type: "GET",
      data: { eShow: eShow },
      success: function (result) {
        $(eShow).html(result);
      },
    });
  }
}
function doEnter(event, obj) {
  if (event.keyCode == 13 || event.which == 13) onSearch(obj);
}
function onSearch(obj) {
  var keyword = $("#" + obj).val();
  if (keyword == "") {
    modalNotify(LANG["no_keywords"]);
    return false;
  } else {
    location.href = "tim-kiem?keyword=" + encodeURI(keyword);
    loadPage(document.location);
  }
}
function goToByScroll(id) {
  var offsetMenu = 0;
  id = id.replace("#", "");
  if ($(".menu").length) offsetMenu = $(".menu").height();
  $("html,body").animate(
    { scrollTop: $("#" + id).offset().top - offsetMenu * 2 },
    "slow"
  );
}
function update_cart(id = 0, code = "", quantity = 1) {
  if (id) {
    var ship = $(".price-ship").val();
    $.ajax({
      type: "POST",
      url: "ajax/ajax_cart.php",
      dataType: "json",
      data: {
        cmd: "update-cart",
        id: id,
        code: code,
        quantity: quantity,
        ship: ship,
      },
      success: function (result) {
        if (result) {
          $(".load-price-" + code).html(result.gia);
          $(".load-price-new-" + code).html(result.giamoi);
          $(".price-temp").val(result.temp);
          $(".load-price-temp").html(result.tempText);
          $(".price-total").val(result.total);
          $(".load-price-total").html(result.totalText);
        }
      },
    });
  }
}
function load_district(id = 0) {
  $.ajax({
    type: "post",
    url: "ajax/ajax_district.php",
    data: { id_city: id },
    success: function (result) {
      $(".select-district").html(result);
      $(".select-wards").html(
        '<option value="">' + LANG["wards"] + "</option>"
      );
    },
  });
}
function load_wards(id = 0) {
  $.ajax({
    type: "post",
    url: "ajax/ajax_wards.php",
    data: { id_district: id },
    success: function (result) {
      $(".select-wards").html(result);
    },
  });
}
function load_ship(id = 0) {
  if (SHIP_CART) {
    $.ajax({
      type: "POST",
      url: "ajax/ajax_cart.php",
      dataType: "json",
      data: { cmd: "ship-cart", id: id },
      success: function (result) {
        if (result) {
          $(".load-price-ship").html(result.shipText);
          $(".load-price-total").html(result.totalText);
          $(".price-ship").val(result.ship);
          $(".price-total").val(result.total);
        }
      },
    });
  }
}
ValidationFormSelf("validation-newsletter-index");
ValidationFormSelf("validation-user");
ValidationFormSelf("validation-contact");
$.fn.exists = function () {
  return this.length;
};
if ($(".paging-product").exists()) {
  loadPagingAjax(
    "ajax/ajax_product.php?perpage=" + PAGING_INDEX,
    ".paging-product"
  );
}
if ($("#show_padding").exists()) {
  var list = $("#show_padding").data("id_list");
  loadPagingAjax(
    "ajax/ajax_product.php?perpage=" + PAGING_INDEX + "&idList=" + list,
    "#show_padding"
  );
  $(".choose_list span").click(function () {
    if ($(".choose_list span").hasClass("choosed")) {
      $(".choose_list span").removeClass("choosed");
    }
    $(this).addClass("choosed");
    var id_list = $(this).attr("data-id_list");
    $("#show_padding").attr("data-id_list", id_list);
    loadPagingAjax(
      "ajax/ajax_product.php?perpage=" + PAGING_INDEX + "&idList=" + id_list,
      "#show_padding"
    );
    return false;
  });
}
NN_FRAMEWORK.BackToTop = function () {
  $(window).scroll(function () {
    if (!$(".scrollToTop").length)
      $("body").append(
        '<div class="scrollToTop"><img src="' + GOTOP + '" alt="Go Top"/></div>'
      );
    if ($(this).scrollTop() > 100) $(".scrollToTop").fadeIn();
    else $(".scrollToTop").fadeOut();
  });
  $("body").on("click", ".scrollToTop", function () {
    $("html, body").animate({ scrollTop: 0 }, 800);
    return false;
  });
};
NN_FRAMEWORK.AltImages = function () {
  $("img").each(function (index, element) {
    if (!$(this).attr("alt") || $(this).attr("alt") == "") {
      $(this).attr("alt", WEBSITE_NAME);
    }
  });
};
NN_FRAMEWORK.FixMenu = function () {
  $(window).scroll(function () {
    var get_height = $("header").height();
    if ($(window).scrollTop() >= get_height) {
      $(".menu").css({
        position: "fixed",
        left: "0px",
        right: "0px",
        top: "0px",
        zIndex: "999",
      });
      $(".menu").addClass("fadeInDown animated");
      $("header").css({ height: get_height });
    } else {
      $(".menu").css({ position: "relative" });
      $(".menu").removeClass("fadeInDown animated");
      $("header").css({ height: "auto" });
    }
  });
};
